import React, { Fragment, useEffect, useState } from 'react';
import { Redirect } from 'react-router-dom';
import anime from 'animejs';

import { WELCOME, EXPERIENCE } from '../constants/routes';

const styles = {
  pageContainer: {
    height: '100vh',
    width: '100vw',
    background: '#2e3440'
  },
  cardsContainer: {
    display: 'flex',
    flexDirection: 'row'
  },
  card: {
    // flexGrow: 1,
    // background: '#eceff4',
    borderRadius: 15,
    margin: 25,
    marginTop: '10vh',
    height: '75vh',
    boxShadow: '0 5px 10px black'
  }
};

const ProjectCards = () => {
  const [toRedirect, setRedirect] = useState({
    destination: ''
  });

  const { destination } = toRedirect;

  useEffect(() => {
    cardsAnimation(true);
  }, []);

  const cardsAnimation = open => {
    const animationDirection = open ? 'normal' : 'reverse';

    anime({
      targets: '.projectCard',
      scaleY: [0, 1],
      direction: animationDirection,
      duration: 750
    });
  };
  const delay = ms => new Promise(res => setTimeout(res, ms));

  const handleClick = async stateVal => {
    cardsAnimation(false);
    await delay(1000);
    setRedirect({ destination: stateVal });
  };

  let toRender;
  if (destination != '') {
    toRender = <Redirect to={destination} />;
  } else {
    toRender = (
      <Fragment>
        <div style={styles.pageContainer}>
          <div style={styles.cardsContainer} className="cardsContainer">
            <div style={styles.card} className="projectCard">
              <svg
                xmlns="http://www.w3.org/2000/svg"
                xmlnsXlink="http://www.w3.org/1999/xlink"
                // width="100%"
                height="100%"
                viewBox="0 0 495 802"
              >
                <defs>
                  <linearGradient
                    id="a"
                    x1="481.83"
                    x2="17.58"
                    y1="14.94"
                    y2="779.79"
                    gradientUnits="userSpaceOnUse"
                  >
                    <stop offset="0" stopColor="#8fbcbb"></stop>
                    <stop offset="0.35" stopColor="#5e777d"></stop>
                    <stop offset="0.9" stopColor="#2e3440"></stop>
                  </linearGradient>
                  <linearGradient
                    x1="1159"
                    x2="1159"
                    y1="356"
                    y2="356"
                    xlinkHref="#a"
                  ></linearGradient>
                </defs>
                <rect width="495" height="802" fill="url(#a)" rx="27.84"></rect>
                <path
                  fill="#ebcb8b"
                  d="M453.55 49a9.66 9.66 0 019.65 9.65v684.7a9.66 9.66 0 01-9.65 9.65H42.16a9.66 9.66 0 01-9.65-9.65V58.65A9.66 9.66 0 0142.16 49h411.39m0-5H42.16a14.65 14.65 0 00-14.65 14.65v684.7A14.65 14.65 0 0042.16 758h411.39a14.65 14.65 0 0014.65-14.65V58.65A14.65 14.65 0 00453.55 44z"
                ></path>
                <path
                  fill="#ebcb8b"
                  d="M339.17 49a123.68 123.68 0 01123.67 123.68v456.64A123.68 123.68 0 01339.17 753H155.83A123.68 123.68 0 0132.16 629.32V172.68A123.68 123.68 0 01155.83 49h183.34m0-5H155.83A128.68 128.68 0 0027.16 172.68v456.64A128.68 128.68 0 00155.83 758h183.34a128.68 128.68 0 00128.67-128.68V172.68A128.68 128.68 0 00339.17 44z"
                ></path>
                <path fill="#ebcb8b" d="M166.75 495H352.75V527H166.75z"></path>
                <path fill="#ebcb8b" d="M191.25 464H328.25V494H191.25z"></path>
                <path fill="#ebcb8b" d="M252.88 230H266.63V464H252.88z"></path>
                <path
                  fill="#ebcb8b"
                  d="M1157.25 296H1418.25V305H1157.25z"
                  transform="rotate(21.58 773.014 -2401.67)"
                ></path>
                <path
                  fill="none"
                  stroke="#ebcb8b"
                  strokeMiterlimit="10"
                  d="M210 356c-1.26-53.86-26.48-90-45-90s-43.74 36.14-45 90"
                ></path>
                <path fill="#ebcb8b" d="M102 356H228V365H102z"></path>
                <path
                  fill="none"
                  stroke="#ebcb8b"
                  strokeMiterlimit="10"
                  d="M390 428c-1.26-53.86-26.48-90-45-90s-43.74 36.14-45 90"
                ></path>
                <path fill="#ebcb8b" d="M282 428H408V437H282z"></path>
              </svg>
            </div>
            <div style={styles.card} className="projectCard">
              <button onClick={() => handleClick('/')}>Back</button>
              <button onClick={() => handleClick('/experience')}>Next</button>
            </div>
            <div style={styles.card} className="projectCard" />
          </div>
        </div>
      </Fragment>
    );
  }

  return toRender;
};

export default ProjectCards;
